    [],nt"revision_timestamp": "2016-07-27T22:22:47.318522",nt"name": "service-catalog-pilot-project-summary",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes the ServCat pilot
    project and offers recommendations for the full-scale implementation of the database.
     During the pilot project a total of 2,473 documents from 10 different refuges
    were entered into the ServCat database.  A document can take anywhere from 5 to
    60 minutes to scan.  Overall, a general approximation is that it takes 30 minutes
    to scan a document and enter it as a record in ServCat.  Several lessons were learned
    throughout the course of the pilot project that will help guide the implementation
    of the data mining effort at the full-scale.  Full-scale implementation of the ServCat
    database will require collaboration between refuges, regions, and the Natural Resource
    Program Center.  Standardizing the metadata entered in ServCat will make it easier
    to find a document in the database and faster to create a record. Templates, the
    master keyword list, and the ServCat Guidance should be used whenever possible to
    expedite data entry.",nt"license_title": "License Not Specified",nt"extras":
